import React, { useState } from 'react';
import {image} from './image1.jpg'
import {Slider} from '.react-slick'

const Carousal = () => {
  const [images, setImages] = useState([
    {image},
    'https://example.com/image2.jpg',
    'https://example.com/image3.jpg',
  ]);

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 2000,
  };

  return (
    <Slider {...settings}>
      {images.map((image) => (
        <div key={image}>
          <img src={image} alt="" />
        </div>
      ))}
    </Slider>
  );
};

export default Carousal;
